// ==UserScript==
// @name         Flat World (Wide Web)
// @namespace    http://tampermonkey.net/
// @version      1.2
// @description  Removes rounded corners from all elements on all web pages.
// @author       PL
// @match        *://*/*
// @grant        none
// @run-at       document-start
// @icon         data:image/png;base64,
// @license      MIT
// @downloadURL https://update.greasyfork.org/scripts/544704/Flat%20World%20%28Wide%20Web%29.user.js
// @updateURL https://update.greasyfork.org/scripts/544704/Flat%20World%20%28Wide%20Web%29.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const css = '* { border-radius: 0px !important; }';
    const style = document.createElement('style');

    style.type = 'text/css';
    style.appendChild(document.createTextNode(css));

    // Append the style to the head, or the root element if head isn't available yet
    (document.head || document.documentElement).appendChild(style);
})();